import React from 'react';
import './HeroSection.css';
import chefPrepVideo from '../assets/chef-prep.mp4';

const HeroSection = () => {
  return (
    <section className="hero-section" id="home">
      <div className="hero-section__video-wrapper">
        <video autoPlay muted loop playsInline className="hero-section__video">
          <source src={chefPrepVideo} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
        <div className="hero-section__video-overlay"></div>
      </div>
      <div className="hero-section__content-container">
        <div className="hero-section__content">
          <div className="hero-section__free-delivery-badge">FREE DELIVERY</div>
          <div className="hero-section__tagline">Delicious Meals. Zero Hassle.</div>
          <h1 className="hero-section__title">Food Sorted. Life's Sorted.</h1>
          <p className="hero-section__description">Feel like home. Eat more, eat healthy. Our food, your place.</p>
          <div className="hero-section__button-group">
            <a href="#daily-combos" className="hero-section__button hero-section__button--primary">Explore Combos</a>
            <a href="#subscription" className="hero-section__button hero-section__button--secondary">View Subscriptions</a>
          </div>
        </div>
      </div>
    </section>
  );
};

export default HeroSection;
